// UUID v4 generator ohne crypto
function uuidv4() {
  return 'xxxxxxxx-xxxx-4xxx-yxxx-xxxxxxxxxxxx'.replace(/[xy]/g, function (c) {
    const r = Math.random() * 16 | 0;
    const v = c === 'x' ? r : (r & 0x3 | 0x8);
    return v.toString(16);
  });
}

function normalizeName(s) {
  if (!s) return '';
  const noDiacritics = s.normalize('NFKD').replace(/[\u0300-\u036f]/g, '');
  const lower = noDiacritics.toLowerCase();
  const underscored = lower.replace(/[^a-z0-9]+/g, '_');
  return underscored.replace(/^_+|_+$/g, '').replace(/_+/g, '_');
}

function makeNodeKey(name, type) {
  const keyBase = normalizeName(name);
  const t = (type || '').toLowerCase();
  return `${t}::${keyBase}`;
}

return items.map(item => {
  const inp = item.json?.output || item.json || {};
  const rawNodes = Array.isArray(inp.nodes) ? inp.nodes : [];
  const rawEdges = Array.isArray(inp.edges) ? inp.edges : [];

  const nodeMap = new Map();     // key -> nodeObj
  const nameIndex = new Map();   // normalized_name -> nodeId

  // Nodes aufbereiten (dedupe + Felder anpassen)
  for (const n of rawNodes) {
    const key = makeNodeKey(n?.name ?? '', n?.type ?? '');
    if (!nodeMap.has(key)) {
      const id = uuidv4();
      const normalizedName = normalizeName(n?.name ?? '');
      const nodeObj = {
        id,
        key,
        name: normalizedName,                 // <- jetzt der normalisierte Wert
        original_name: n?.name ?? '',         // <- Originalname protokolliert
        type: (n?.type ?? '').toLowerCase(),
        description: n?.description ?? '',
      };
      nodeMap.set(key, nodeObj);
      if (!nameIndex.has(normalizedName)) {
        nameIndex.set(normalizedName, id);
      }
    }
  }

  // Edges auflösen über normalisierte Namen
  const edges = [];
  for (const e of rawEdges) {
    const srcNorm = normalizeName(e?.source ?? '');
    const tgtNorm = normalizeName(e?.target ?? '');
    const srcId = nameIndex.get(srcNorm);
    const tgtId = nameIndex.get(tgtNorm);
    if (srcId && tgtId) {
      edges.push({
        id: uuidv4(),
        source_id: srcId,
        target_id: tgtId,
        relationship: e?.relationship ?? null,
        relationship_short: e?.relationship_short ?? null,
        relationship_strength: e?.relationship_strength ?? null,
      });
    }
  }

  return {
    json: {
      nodes: Array.from(nodeMap.values()),
      edges,
      generated_at: new Date().toISOString(),
    }
  };
});

// Für jedes Item: Nodes indexieren -> Edges mit eingebetteten Knoten bauen
return items.map(item => {
  const inp = item.json || {};
  const nodes = Array.isArray(inp.nodes) ? inp.nodes : [];
  const edges = Array.isArray(inp.edges) ? inp.edges : [];

  // Map: nodeId -> nodeObj
  const byId = new Map(nodes.map(n => [n.id, n]));

  const mergedEdges = edges.map(e => {
    const src = byId.get(e.source_id);
    const tgt = byId.get(e.target_id);

    // Fallbacks, falls ein Knoten nicht gefunden wird
    const out = {
      id: e.id,
      relationship: e.relationship ?? null,
      relationship_short: e.relationship_short ?? null,
      relationship_strength: e.relationship_strength ?? null,
    };

    if (src) out.source = src; else out.source_id = e.source_id ?? null;
    if (tgt) out.target = tgt; else out.target_id = e.target_id ?? null;

    return out;
  });

  return {
    json: {
      edges: mergedEdges,
      generated_at: inp.generated_at || new Date().toISOString(),
    }
  };
});
